import React from "react";
import { Form } from "react-bootstrap";
import { Button } from "bootstrap";
// import { Form.Group,Form.Label,Form.Control,Form.text } from "react-bootstrap";
const Download = () => {
  return (
    <div className="down">
      <button className="btn btn-success">Download_CSV</button>
      <Form>
            <Form.Group className="mb-3" controlId="formBasicEmail">
                <Form.Label>Airway Bill</Form.Label>
                <Form.Control type="text" placeholder="Enter airway Bill" />
            </Form.Group>
            <Button variant="primary" type="submit">
    Submit
  </Button>
            </Form>
    </div>
  );
};
export default Download;
